/***************************************************/
/* Custom fluid container sizes                    */
/***************************************************/

// left & right margins being implemented using `padding` property,
// they are part of the element size (because of `box-sizing: border-box`).
// So from the sized defined in the dsfr documentation
// (https://www.systeme-de-design.gouv.fr/elements-d-interface/fondamentaux-techniques/grille-et-points-de-rupture)
// that only apply for the content of the container, we also need to add the 1.5rem (24px) * 2 margins, 
// so that it has the correct size
// (These sizes need to be aligned with Demarches.Code.SetLayoutContainerWidthSSX)
@container-fluid-sm: 800px + @grid-gutter-width;
@container-fluid-md: 1000px + @grid-gutter-width;
@container-fluid-lg: 1200px + @grid-gutter-width;
@container-fluid-xl: 1400px + @grid-gutter-width;

.container-fluid-sized(@size) {
  .container-fixed();
  width: @size;
  max-width: 100%;
}

.container-fluid-sm {
  .container-fluid-sized(@container-fluid-sm);
}

.container-fluid-md {
  .container-fluid-sized(@container-fluid-md);
}

.container-fluid-lg {
  .container-fluid-sized(@container-fluid-lg);
}

.container-fluid-xl {
  .container-fluid-sized(@container-fluid-xl);
}



