/*
 * Add underline for link
 * Do not break existing links that expect not to be underlined by default
 * (like bootstrap `a` tags used as buttons, or other XWiki `a` tags)
 */
#xwikicontent {
  a[href]:not(.btn):not([type="button"]):not([role="button"]):not(ul.nav > li > a):not(ul.dropdown-menu > li > a) {
    text-decoration: underline;
    text-underline-offset: 2px;
  }
}

